import { useDispatch } from 'react-redux'
import { setName } from '../store/actions.js';

const changeName = () => {

    const dispatch = useDispatch();
  
    const changeName = () => {
     dispatch(
      setName({
        name: "Петр"
      })
     )
    }
  
    return <button onClick={changeName}>Изменить</button>
  }

  export default changeName
